import React from "react";
import ReactDOM from "react-dom";

import App from "./App";

const client = new ApolloClient({
  uri: "http://localhost:3001/graphql",
  cache: new InMemoryCache(),
});
ReactDOM.render(
  <React.StrictMode>
            <ApolloProvider client={client} />

    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
